// App.js
import React, { useState } from 'react';
import Collapsible from './Collapsible';

function App() {
  const [output1, setOutput1] = useState('');
  const [output2, setOutput2] = useState('');

  const handleFileUpload = async (event) => {
    const file = event.target.files[0];
    const formData = new FormData();
    formData.append('file', file);

    const response = await fetch('http://localhost:5000/upload', {
      method: 'POST',
      body: formData,
    });

    const data = await response.json();
    setOutput1(data.output1);
    setOutput2(data.output2);
  };

  const handleOtherFileUpload = async (event) => {
    const file = event.target.files[0];
    const formData = new FormData();
    formData.append('file', file);

    // You can modify the URL and method as needed for the backend handling
    await fetch('http://localhost:5000/other_upload', {
      method: 'POST',
      body: formData,
    });
  };

  return (
    <div className="App">
      <input type="file" onChange={handleFileUpload} />
      <input type="file" onChange={handleOtherFileUpload} />
      {output1 && <Collapsible title="Output 1" content={output1} />}
      {output2 && <Collapsible title="Output 2" content={output2} />}

    </div>
  );
}

export default App;
